import React, { useEffect, useState } from 'react'
import { useUserContext } from '../context/userContext';
import { useNavigate } from 'react-router-dom';
import Styled from '../components/common/Button.Styles';

export default function HomePage() {
  const { accessToken } = useUserContext();
  const [userLoggedIn, setUserLoggedIn] = useState(false)
  const navigate = useNavigate();

  useEffect(() => {
    if(accessToken){
      setUserLoggedIn(true)
    }

  },[]);


  return (
    <div>
      HomePage
      {
        userLoggedIn ? (<p>hello user</p>) : 
        (
          <div>
            <div>
              <p>Already have an account?, login please
              <Styled.Button onClick={()=> navigate('/login')}/></p>
            </div>
            <div>
              <p>Do not have an account?, signup please
              <Styled.Button onClick={()=> navigate('/signup')}/></p>
            </div>
          </div>
        )
      }
    </div>
  )
}
